import * as React from 'react';
import { View, Button, Text } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

// Definirajte komponente za svaku stranicu
function GlavniZbornikScreen({ navigation }) {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Text>Glavni Zbornik Page</Text>
    </View>
  );
}

// Ponovite gornji kod za ostale stranice...

// Stvorite stack navigator
const Stack = createStackNavigator();

function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Home">
        <Stack.Screen name="GlavniZbornik" component={GlavniZbornikScreen} />
        {/* Dodajte ostale Screen komponente ovdje */}
      </Stack.Navigator>
    </NavigationContainer>
  );
}

export default App;
